    return (
        <div>
            <div className="team-section py-5">
                <div className="team-container">
                    <h1 className="homePage-title text-center">Our Team</h1>
                    <p className="homePage-p text-center">Lorem ipsum dolor sit amet consectetur adipisicing elit.</p>
                    <div className="row">
                        <div className="col-md-3">
                            <img src={Image1} alt="" />
                            <h4>Shafi Ali</h4>
                            <p>Expert Programer</p>
                            <p>Lorem ipsum dolor sit amet consectetur, adipisicing elit. Repellat sequi doloremque, voluptatum recusandae quisquam commodi.</p>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default Team;
